import React from 'react';
import { AppBar, Toolbar, Typography, Button, Box } from '@mui/material';
import { styled } from '@mui/material/styles';
import YouTubeIcon from '@mui/icons-material/YouTube';

const StyledAppBar = styled(AppBar)(({ theme }) => ({
  background: 'linear-gradient(135deg, #1a1a2e 0%, #16213e 100%)',
  boxShadow: '0 4px 30px rgba(0, 0, 0, 0.1)',
  backdropFilter: 'blur(10px)',
}));

const StyledToolbar = styled(Toolbar)({
  display: 'flex',
  justifyContent: 'space-between',
  padding: '1rem 2rem',
});

const Logo = styled(Box)({
  display: 'flex',
  alignItems: 'center',
  gap: '0.5rem',
  '& .MuiSvgIcon-root': {
    fontSize: '2rem',
    color: '#ff0000',
  },
});

const NavLinks = styled(Box)({
  display: 'flex',
  gap: '2rem',
  alignItems: 'center',
});

const NavButton = styled(Button)({
  color: 'white',
  textTransform: 'none',
  fontSize: '1rem',
  '&:hover': {
    background: 'rgba(255, 255, 255, 0.1)',
  },
});

const GetStartedButton = styled(Button)({
  background: 'linear-gradient(45deg, #ff0000 30%, #ff4b2b 90%)',
  color: 'white',
  padding: '0.5rem 1.5rem',
  borderRadius: '25px',
  textTransform: 'none',
  fontSize: '1rem',
  boxShadow: '0 3px 15px rgba(255, 0, 0, 0.2)',
  '&:hover': {
    background: 'linear-gradient(45deg, #ff4b2b 30%, #ff0000 90%)',
  },
});

const Header = () => {
  return (
    <StyledAppBar position="fixed">
      <StyledToolbar>
        <Logo>
          <YouTubeIcon />
          <Typography variant="h6" sx={{ fontWeight: 'bold' }}>
            YT Downloader
          </Typography>
        </Logo>
        <NavLinks>
          <NavButton>الرئيسية</NavButton>
          <NavButton>المميزات</NavButton>
          <NavButton>كيفية الاستخدام</NavButton>
          <GetStartedButton variant="contained">
            ابدأ التحميل
          </GetStartedButton>
        </NavLinks>
      </StyledToolbar>
    </StyledAppBar>
  );
};

export default Header;
